        event.preventDefault();
        //setIsLoading(true);
        try {
            await addGoal({

            }).then((data) => {
                console.log(data);
            });
            //clear form values after submit complete

        } catch (e) {
            console.log(e);
        }
    }



    /*componentDidMount = async () => {

    }*/
    return (
        <div style={{ flexGrow: 1 }}>
            <Paper style={{ padding: '1rem' }}>
                <Typography variant="h4">Browse &amp; Add Goals</Typography>
                <Container>
                    <Accordion>
                        <AccordionSummary
                            expandIcon={<ExpandMoreIcon />}
                        >
                            <Typography variant="h6">Articulation</Typography>
                        </AccordionSummary>
                        <AccordionDetails>
                            <Grid container spacing={1}>
                                {goalBank.map((goal) => (
                                    <Grid item >
                                        <Card style={{ padding: 2, textAlign: 'center' }}>
                                            <CardContent>
                                                <TableContainer>
                                                    <Table>
                                                        <TableHead>
                                                            <TableRow>
                                                                <TableCell align="left">{goal.description}</TableCell>
                                                                <TableCell align="left"><Button>Add</Button></TableCell>
                                                            </TableRow>
                                                        </TableHead>
                                                        <TableBody>
                                                            <TableRow>
                                                                <TableCell align="left">Uliana Y.</TableCell>
                                                                <TableCell align="right" style={{ fontWeight: '600' }}>Nov. 27, 2020</TableCell>
                                                            </TableRow>
                                                        </TableBody>
                                                    </Table>
                                                </TableContainer>
                                            </CardContent>
                                        </Card>
                                    </Grid>
                                ))}
                            </Grid>
                        </AccordionDetails>
                    </Accordion>
                </Container>
            </Paper>
        </div>
    )
}

export default ViewGoals
